import * as React from 'react';
import Modal from 'react-modal';

import * as S from './WinModal.style';

interface IProps {
    isOpen: boolean,
    playerName: string
}

const WinModal: React.FC<IProps> = ({ isOpen, playerName }) => (
    <Modal isOpen={isOpen}>
        <S.Title>Congratulations</S.Title>
        <S.Text>Player { playerName } WIN!</S.Text> 
    </Modal>
);

export default WinModal;
